import React, { Fragment } from "react";
import { Container, Logo, Menu } from "./styles";

const Header = () => {
    return (
        <Container>
            <Logo>
                <img scr="" alt="">
                </img>
            </Logo>
            <Menu>
                <ul>
                    <li>
                        <span> Cadastro/Login</span>
                    </li>
                </ul>
            </Menu>

        </Container>
    )
}

export default Header;
